import React, { useState } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import styled from 'styled-components';
import ExecutiveDashboard from './comprehensive/ExecutiveDashboard';
import DetailedFindings from './comprehensive/DetailedFindings';
import GeographicAnalysis from './comprehensive/GeographicAnalysis';
import StatisticalAnalysis from './comprehensive/StatisticalAnalysis';
import MethodologyDetails from './comprehensive/MethodologyDetails';
import PolicyAnalysis from './comprehensive/PolicyAnalysis';
import LiteratureContext from './comprehensive/LiteratureContext';
import DataExplorer from './comprehensive/DataExplorer';
import AdvancedTemporalAnalysis from './comprehensive/AdvancedTemporalAnalysis';
import DeepStatisticalModeling from './comprehensive/DeepStatisticalModeling';
import EnhancedSpecialtyAnalysis from './comprehensive/EnhancedSpecialtyAnalysis';
import EnhancedGeographicAnalysis from './comprehensive/EnhancedGeographicAnalysis';
import CHCPatientImpactAnalysis from './comprehensive/CHCPatientImpactAnalysis';
import ComprehensiveHeader from './comprehensive/ComprehensiveHeader';
import NavigationTabs from './comprehensive/NavigationTabs';
import './comprehensive/ComprehensiveStyles.css';

const AppContainer = styled.div`
  min-height: 100vh;
  background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
`;

const ContentContainer = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  background: white;
  box-shadow: 0 0 50px rgba(0,0,0,0.2);
  border-radius: 12px;
  overflow: hidden;
  position: relative;
`;

const TabContent = styled(motion.div)`
  min-height: 80vh;
`;

const sections = [
  { id: 'dashboard', label: 'Executive Dashboard', icon: '📊' },
  { id: 'findings', label: 'Detailed Findings', icon: '🔍' },
  { id: 'temporal', label: 'Advanced Temporal', icon: '📈' },
  { id: 'specialty', label: 'Enhanced Specialty', icon: '👩‍⚕️' },
  { id: 'geographic', label: 'Geographic Analysis', icon: '🗺️' },
  { id: 'chc-impact', label: 'CHC & Patient Impact', icon: '🏥' },
  { id: 'statistical', label: 'Statistical Analysis', icon: '📈' },
  { id: 'modeling', label: 'Deep Statistical Modeling', icon: '🧮' },
  { id: 'methodology', label: 'Methodology', icon: '⚙️' },
  { id: 'policy', label: 'Policy Analysis', icon: '🏛️' },
  { id: 'literature', label: 'Literature Context', icon: '📚' },
  { id: 'explorer', label: 'Data Explorer', icon: '🔬' }
];

const ComprehensiveApp = () => {
  const [activeSection, setActiveSection] = useState('dashboard');

  const renderContent = () => {
    switch (activeSection) {
      case 'dashboard':
        return <ExecutiveDashboard />;
      case 'findings':
        return <DetailedFindings />;
      case 'temporal':
        return <AdvancedTemporalAnalysis />;
      case 'specialty':
        return <EnhancedSpecialtyAnalysis />;
      case 'geographic':
        return <EnhancedGeographicAnalysis />;
      case 'chc-impact':
        return <CHCPatientImpactAnalysis />;
      case 'statistical':
        return <StatisticalAnalysis />;
      case 'modeling':
        return <DeepStatisticalModeling />;
      case 'methodology':
        return <MethodologyDetails />;
      case 'policy':
        return <PolicyAnalysis />;
      case 'literature':
        return <LiteratureContext />;
      case 'explorer':
        return <DataExplorer />;
      default:
        return <ExecutiveDashboard />;
    }
  };

  return (
    <AppContainer>
      <ContentContainer>
        <ComprehensiveHeader />
        <NavigationTabs 
          sections={sections}
          activeSection={activeSection}
          onSectionChange={setActiveSection}
        />

        <AnimatePresence mode="wait">
          <TabContent
            key={activeSection}
            initial={{ opacity: 0, x: 300 }}
            animate={{ opacity: 1, x: 0 }}
            exit={{ opacity: 0, x: -300 }}
            transition={{ duration: 0.5, ease: "easeInOut" }}
          >
            {renderContent()}
          </TabContent>
        </AnimatePresence>
      </ContentContainer>
    </AppContainer>
  );
};

export default ComprehensiveApp;
